import "./App.css";
import Header from "./components/layout/Header";
import Banner from "./components/banner/Banner";
import Main from "./components/layout/Main";
import Footer from "./components/layout/Footer";

function App() {
  return (
    <>
      <Header></Header>
      <Menu></Menu>
      <Banner></Banner>
      <Main></Main>
      <Footer></Footer>
    </>
  );
}

export default App;
